import React from "react";
import PropTypes from 'prop-types';

const Header = ({ number }) => {
  return (
    <>
      <h1>{number + 1}</h1>
    </>
  );
};

const App = () => {
  const number = '넘버';
  return (
    <>
      <Header number={number}/>
    </>
  );
};

Header.propTypes = {
  number: PropTypes.number,
};

export default App;
// export { App };
